import React from "react";

const day1 = () => {
  return (
    <div>
      <h1>Full HTML tags</h1>
      <header>This are part of under semantic elements</header>
      <nav>Navbar</nav>
      <section>this is section tag</section>
      <article>this is article tag</article>
      <footer>footer tag</footer>
    </div>
  );
};

export default day1;
